```java
public class Solution {
    public boolean isPowerOfThree(int n) {
        if (n <= 0) {
            return false;
        }
        while (n % 3 == 0) {
            n /= 3;
        }
        return n == 1;
    }
}
```

This solution works by repeatedly dividing the number by 3 until it is no longer divisible by 3. If the number is now 1, then it is a power of three.

The time complexity of this solution is O(log n), which is the best we can do for this problem because we need to check each digit of the number. The space complexity is O(1), as we are not using any extra space that scales with the input size.

