Here is a Python program that uses dynamic programming to find the nth Fibonacci number:

```python
def fibonacci(n):
    if n <= 0:
        return "Input should be a positive integer."
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    else:
        fib_list = [0, 1]
        for i in range(2, n):
            fib_list.append(fib_list[i-1] + fib_list[i-2])
        return fib_list[n-1]

print(fibonacci(10))
```

This program first checks if the input is a positive integer. If not, it returns an error message. If the input is 1 or 2, it returns 0 or 1, respectively. For any other input, it calculates the nth Fibonacci number by using dynamic programming. It creates a list `fib_list` with the first two Fibonacci numbers, then iterates from 3 to n, appending the sum of the previous two numbers to the list. Finally, it returns the nth Fibonacci number from the list.

Here is a Python implementation of a binary search algorithm:

```python
def binary_search(arr, low, high, x):
    if high >= low:
        mid = (high + low) // 2
        if arr[mid] == x:
            return mid
        elif arr[mid] > x:
            return binary_search(arr, low, mid - 1, x)
        else:
            return binary_search(arr, mid + 1, high, x)
    else:
        return -1
```

This function takes an array, a starting index, a ending index, and a value as input. It returns the index of the value in the array if it is present, else it returns -1.

